    //         // ...
    //     })
    //     .catch((error) => {
    //         var errorCode = error.code;
    //         var errorMessage = error.message;
    //         // ..
    //     });

       return (
                <SafeAreaView style={loginStyle.content}>
                    <View style={loginStyle.view}>
                        <Card>
                            <Card.Title title="Mobility Center" titleStyle={loginStyle.cardTitle}></Card.Title>
                            <Card.Content>
                                <TextInput
                                    placeholder="Email"
                                    label="User"
                                    keyboardType="email-address"
                                    onChangeText={value => setEmail(value)}
                                    value={email}
                                />
                                <TextInput
                                    label="Password"
                                    secureTextEntry={true}
                                    onChangeText={value => setPassword(value)}
                                    value={password}
                                />
                                {/*{errorLogin === true*/}
                                {/*    ?*/}
                                {/*    <View style={loginStyle.contentAlert}>*/}
                                {/*        <MaterialCommunityIcons*/}
                                {/*        name="alert-circle"*/}
                                {/*        size={24}*/}
                                {/*        color="#bdbdbd"*/}
                                {/*        />*/}
                                {/*        <Text style={loginStyle.warningAlert}>E-mail ou senha invalido</Text>*/}
                                {/*    </View>*/}
                                {/*    :*/}
                                {/*    <View></View>*/}
                                {/*}*/}
                                {email === "" || password === ""
                                ?
                                    <TouchableOpacity
                                    disabled={true}
                                    ><Button mode="contained" style={loginStyle.cardButton}>Login</Button>
                                    </TouchableOpacity>
                                :
                                    <TouchableOpacity
                                        disabled={true}
                                    ><Button onPress={logar} mode="contained" style={loginStyle.cardButton}>Login</Button>
                                    </TouchableOpacity>
                                }
                                <Button uppercase={false} style={loginStyle.cardButton}>Esqueceu email/password?</Button>

                                <Button onPress={register} style={loginStyle.cardButton}>Register</Button>
                            </Card.Content>
                        </Card>
                    </View>
                </SafeAreaView>
    );
}

export default Login;
